@JillFanoO4 I know what I'd do. 
At dawn, after sleeping in my car in the Goodman KS Walmart, I found 6+ $100 bills blowing in the wind in the lot. I chased them down &amp; turned them in at the svc desk. I pictured some desperate person getting home without it.
I wish I knew how the story ended

@MeidasTouch OK SCOTUS, you want to consider historical precedent? 
Great! You know what was a traditional method to settle disputes in 1791? Dueling. 
While not mentioned in the Constitution, I'm sure its restoration to today's society could be argued using originalism and texualism theory.
